import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Banner from '../components/Banner'
import CarCard from '../components/CarCard'
import NavbarLoggedIn from '../components/NavbarLoggedin'
import FooterLoggedIn from '../components/FooterLoggedIn'
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import { withStyles } from '@material-ui/core/styles';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';

const OurModels = () => {

    var AuthNavbar = '';
    var AuthFooter = '';

if(localStorage.getItem('auth_token'))

{

    AuthNavbar = (
     <NavbarLoggedIn/>
                );

    AuthFooter = (
     <FooterLoggedIn/>
                );


} else {

  AuthNavbar = (
     <Navbar/>
                );

    AuthFooter = (
     <Footer/>
                );            

    
}
const useStyles = makeStyles((theme) => ({

  formControl: {
    margin: theme.spacing(1),
    minWidth: 200,
    outline: 100,
    border: '1px solid 9c1a1a',
    background: 'transparent',
    color: 'white',
  },

  Label: {
  
  color: 'white'


  },

    input: {
    borderRadius: 4,
    position: 'relative',
    backgroundColor: theme.palette.background.paper,
    border: '1px solid #ced4da',
    fontSize: 16,
    padding: '10px 26px 10px 12px',
    transition: theme.transitions.create(['border-color', 'box-shadow']),
    // Use the system font instead of the default Roboto font.
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
    '&:focus': {
      borderRadius: 4,
      borderColor: '#80bdff',
      boxShadow: '0 0 0 0.2rem rgba(0,123,255,.25)',
    },
  },
}))(InputBase);



const classes = useStyles();
  const [value, setValue] = React.useState('');
  const [open, setOpen] = React.useState(false);

  const handleChange = (event) => {
    setValue(event.target.value);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };







  return (
    <div>
      <div className="empty_space"></div>
      {AuthNavbar}
      <Banner title="Modelljeink" />

      <div className="filter_container">
        <form>
        <FormControl className={classes.formControl}>
        <InputLabel>Kategória</InputLabel>
        <Select
          labelId="demo-controlled-open-select-label"
          id="demo-controlled-open-select"
          open={open}
          onClose={handleClose}
          onOpen={handleOpen}
          value={value}
          onChange={handleChange}
          
        >
          <MenuItem value="" disabled> Kategória</MenuItem>
          <MenuItem value={'Sedan'}>Sedan</MenuItem>
          <MenuItem value={'Kombi'}>Kombi</MenuItem>
          <MenuItem value={'Hibrid'}>Hibrid</MenuItem>
          <MenuItem value={'Furgon'}>Furgon</MenuItem>
        
        </Select>
      </FormControl>




         </form>
      
      </div>


      <div className="car_card_container">
      <CarCard />
      <CarCard />
      <CarCard />
      </div>



      {AuthFooter}


    </div>
  )
}

export default OurModels
